        "Desc": "穢れのない鳥の羽としなやかな布で作られた「特別なバドルドー」、モンドの伝統祭りである「バドルドー祭」の核心である。<br>鳥は風を御する生き物で、鳥の羽には「風に乗る」と言う祝福が込められている。そのため、バドルドーはバルバトスの加護をもたらすだけでなく、不思議な力があるとモンドの民は深く信じている…",
